import Home from './compontes/home';
import './App.css';
import{BrowserRouter as Router,Routes,Route}from "react-router-dom"
import Produts from './compontes/produts';

function App() {
  return (
    <div >


      <Router>
        <Routes>
          <Route path="/" element={<Home/>}/>
          <Route path="/produts" element={<Produts/>}/>


        </Routes>
      </Router>

    </div>
  );
}

export default App;
